import mainLogo from "../assets/argentBankLogo.png";

function EditUser() {
  return (
    <div className="editUser-wrapper">
      <div className="editUser-nav">
        <img
          className="main-nav-logo-image"
          src={mainLogo}
          alt="Argent Bank Logo"
        />
        <div className="editUser-btns">
            <span>Username</span>
            <i className="fa fa-user-circle"></i>
            <i className="fa fa-user-circle"></i>
            <i className="fa fa-user-circle"></i>
        </div>
      </div>
      <div className="editUser-form">
        
      </div>
    </div>
  );
}

export default EditUser
